import React from "react";
import "./styles/footer.css";

function Footer() {
  return (
    <div class="footer">
      <div class="container">
        <span class="text-muted">
          Prueba Test Front End Developer | Diego Betancourt 2020
        </span>
      </div>
    </div>
  );
}

const orderTypes = {
  desc: {
    class: "sort-up",
    fn: (a, b) => a.net_worth - b.net_worth,
  },
  asc: {
    class: "sort-down",
    fn: (a, b) => b.net_worth - a.net_worth,
  },
  default: {
    class: "sort",
    fn: (a, b) => a,
  },
};

export default Footer;
